import { Form, Field } from 'react-final-form'

const DeleteUser = ({entity, handleUpdateChange}) => {

    const onSubmit = () => {
        console.log("SUBMIT")
    }

        return (

            <Form 
            onSubmit={onSubmit}>
            onChange={handleUpdateChange}
            render={({ handleSubmit, form, submitting, pristine, values }) => (
            <form 
            onSubmit={props.handleSubmit}
            initialValues={{ firstName: entity.firstName, lastName: entity.lastName }}
            >
                <div className="modalText">
                <Field
                className="modalTextInput" 
                name="firstName"
                component="input"
                type="text"
                placeholder="First Name"
                defaultValue={entity.firstName}
                onChange={event => handleUpdateChange(event)}
                />
                </div>
                <div className="modalText">

                <Field

                className="modalTextInput" 
                name="lastName"
                component="input"
                type="text"
                placeholder="Last Name"
                defaultValue={entity.lastName}
                />
                </div>

            </form>
            )}
            </Form>
        )

}

export default DeleteUser;
